    render() {
        const styles={
            width:'90%',
            height:'15vh'
        }
        return (
            <div>

                <UserIcon />
                <Hamburger />
                <p className="cityPageMsg">Filter our current cities:</p> 
                <Filter />
                {/* <CityDisplay/> */}
